    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1945. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, and fish- is also covered. The Refuge development and maintenance
    section discusses wildfires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses
    and fishing.",nt"license_title": "License Not Specified",nt"extras":
